import React from 'react';
import Image from './image.jpg';

const Camera = () => {
    return(
        <div  className=' mv4 w-100 w-50-m w-25-l center'>
            <div className='pa4 black-80' >
                <img 
                    src={Image}
                    width='auto'
                    height='400px'
                />
                <div className='f2' >
                    <p>Place: Home</p>
                    <p>Time: 12:00:00 PM</p>
                    <p>User: Mikan</p>
                    <p>Date: 03/10/2019</p>
                    <p>In/Out: In</p>
                </div>
                <div className="lh-copy mt3 center">
                    <p className="f3 link dim black db pointer shadow-5">Punch</p>
                </div>
            </div>
        </div>
    )
}

export default Camera;
